import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div>
    <Button variant='primary'>
        Кнопка
    </Button>
     <Button variant="outline-light">Light</Button>
     </div>
  );
}

export default App;
